import { useNavigate } from "react-router-dom";

export default function Logout(props) {
  const userData = props.currentUser;

  let navigate = useNavigate();

  if (userData) {
    localStorage.removeItem("userData");
    navigate("/");
    window.location.reload();
  }
}
